const RedRoverCommand = require('..')
const config = {
  host: 'cor-t1ec1.2ds8op.0001.usw2.cache.amazonaws.com'
}
// const config = {
//   port: 32768
// }
const redRover = new RedRoverCommand(config)

const DURRATION = 5000
const CHANNEL = 'events'
const publisher = redRover.publisher()

function test(message, stop) {
  let go = true
  let count = 0
  let timer

  const subscriber = redRover.subscriber()
  subscriber.subscribe(CHANNEL)
    .then((count) => {
      subscriber.on('message', onMessage)
      if (!timer) timer = startTimer()
      publisher.publish(CHANNEL, message)
    })


  function onMessage(channel, msg) {
    count++
    if (go) {
      publisher.publish(CHANNEL, message)
    } else {
      subscriber.unsubscribe(CHANNEL)
        .then(() => {
          subscriber.quit()
          stop(count)
        })
    }
  }

  function startTimer() {
    return setTimeout(() => { go = false }, DURRATION)
  }
}

function run(message) {
  return new Promise((resolve) => {
    test(message, (count) => {
      console.log(`Size: ${byteCount(message)}b Time: ${DURRATION} Count: ${count}`)
      resolve()
    })
  })
}

function byteCount(s) {
  return encodeURI(s).split(/%..|./).length - 1;
}

const b10 = '1234567890'
const b100 = '1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890'
const k1 = ''
const k10 = ''
const k100 = ''

run(null)
  .then(() => run(b10))
  .then(() => run(b100))
  .then(() => run(k1))
  .then(() => run(k10))
  .then(() => run(k100))
